import React from 'react';
import logo from './logo.png';

const About = () => {
    return (
        <div className='tc ph4'>
            <div>
              <h1 className='f3 f2-m f1-l fw2 black-90 mv3'>Bruno Cunha</h1>
              <h2>My personal portfolio</h2>
            </div>
        </div>
    );
}

export default About;
